import React, { Component } from "react";
import TextBox from "/Users/kraken/Desktop/bulls/src/shared/Components/TextBox/TextBox.js";
import "../../.././assets/index.css";

export default class Login extends Component{

    render(){
        return (

            <div className="row justify-content-center">
                <div class="col-10 mt-3" style={{display:"flex", justifyContent:"center",alignItems:"center"}}>
                    <h2 >Forgot Password</h2>
                </div>
                <div className="row justify-content-center">
                    <div class="col-10 mt-3">
                        <TextBox inputType="text" placeholder="Enter Mobile" label="Mobile Number"/>
                    </div>
                </div>

                <div className="row justify-content-center">
                    <div class="col-10 mt-3">
                        <TextBox inputType="password" placeholder="Enter Password" label="Password"/>
                    </div>
                </div>

                <div className="row justify-content-center">
                    <div class="col-10 mt-3">
                        <button type="submit" class="btn btn-primary">Sign In</button>
                    </div>
                </div>
            </div>
        );
    }
}
